import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";

const IngenieriaAmbiental = () => {
  const servicios = [
    "Manifestación de impacto ambiental",
    "Informe preventivo",
    "Estudios de riesgo",
    "Programa de prevención de accidentes",
    "Cédula de operación anual",
    "Estudios de emisiones a la atmósfera",
    "Análisis de aguas residuales",
    "CRETI",
    "Suelos contaminados",
    "Estudios de ambiente laboral",
  ];

  return (
    <div className="container my-5">
      <div className="card shadow border-0 rounded-4 overflow-hidden">

        {/* Imagen superior */}
        <img
          src="/IMG_1551_edited.png"
          alt="Ingeniería Ambiental"
          className="img-fluid w-100"
          style={{ maxHeight: "220px", objectFit: "cover" }}
        />

        {/* Contenido */}
        <div className="card-body bg-white p-5">
          <h1 className="text-center text-success fw-bold mb-4">
            INGENIERÍA AMBIENTAL
          </h1>

          <h5 className="fw-semibold text-primary mb-3 border-bottom pb-2">
            <i className="bi bi-gear-wide-connected me-2"></i>
            Servicios ofrecidos
          </h5>

          <ul className="list-group list-group-flush">
            {servicios.map((servicio, index) => (
              <li
                key={index}
                className="list-group-item d-flex align-items-center gap-2"
              >
                <i className="bi bi-check-circle-fill text-success"></i>
                {servicio}
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default IngenieriaAmbiental;
